import React from 'react';
import List from '@material-ui/core/List';
import ListItem from '@material-ui/core/ListItem';
import ListItemIcon from '@material-ui/core/ListItemIcon';
import FeedbackIcon from '@material-ui/icons/Feedback';
import ListItemText from '@material-ui/core/ListItemText';

function Directory() {

    function link(route){
        window.location.href = `/flashcards/${route}`;
    }

    return (
        <List>
        <ListItem button onClick={()=>link('phrases')}>
                <ListItemIcon>
                    <FeedbackIcon/>
                </ListItemIcon>
                <ListItemText primary={'phrases'}/>
                phrases
            </ListItem>
            <ListItem button onClick={()=>link('question')}>
                <ListItemIcon>
                    <FeedbackIcon/>
                </ListItemIcon>
                <ListItemText primary={'questions'}/>
                questions
            </ListItem>
            <ListItem button onClick={()=>link('vocab')}>
                <ListItemIcon>
                    <FeedbackIcon/>
                </ListItemIcon>
                <ListItemText primary={'vocab'}/>
                vocab
            </ListItem>
            <ListItem button onClick={()=>link('all')}>
                <ListItemIcon>
                    <FeedbackIcon/>
                </ListItemIcon>
                <ListItemText primary={'all'}/>
                all
            </ListItem>
        </List>
    )
}

export default Directory;
